import './details.css';


function Details () {
    return (
        <div className="details">
            <h2>Details</h2>
            <div className="items">
            <div className="firstitem">
                <p>Membership Type</p>
                <p>Status</p>
                <p>Commencement Date</p>
                <p>Expiration Date</p>
                <p>Action</p>
            </div>
            </div>
        </div>
    )
};

export default Details;
